spawn("script_entity", 5,21,0, "quakeScript")
	:setSource("quakeInterval = 5000\
function setQuakeDelay()\
--quakeInterval = math.random(13,15) -- FOR TESTING\
quakeInterval = math.random(3600,8000)\
--pr.nt(\"quakeInterval set to \"..quakeInterval)\
end\
\
quakeEventTick = 0\
function quakeEventTicker() -- trig by univTimerScript.univTicker() 1s\
  if quakeEventTick < quakeInterval then\
     quakeEventTick = quakeEventTick + 1\
--   pr.nt(\"quakeEventTick \"..quakeEventTick)\
    else\
     quakeStart() -- start an earthquake\
     setQuakeDelay() -- set a new delay time for the next quake\
     quakeEventTick = 0 -- reset the tick count for the next quake\
  end\
end\
---------------------------------\
\
\
function quakeStart()\
  noSleep()\
  if math.random() < 0.33 then -- a 33% chance\
     tickAmount = 70\
     playSound(\"earthquake_8s\")\
    else -- a 67% chance\
     tickAmount = 100\
     playSound(\"earthquake_11s\")\
  end\
  makeDstTimers()\
end\
\
quakeNow = 0\
\
function noSleep() -- trig by quakeStart(), deathQuakeScript.quakeStart()\
  quakeNow = 1\
end\
---------------------------------------\
\
\
function makeDstTimers() -- trig by quakeStart()\
  for i=1,5 do\
     spawn(\"timer\",i,0,0,0,\"quakeDustTimer\"..i)\
      :setTimerInterval(0.1)\
      :addConnector(\"activate\", \"quakeScript\", \"dustTimer\")\
      :activate()\
  end\
--pr.nt(\"quakeDustTimers spawned on every level\")\
end\
\
function dustTimer(timer)\
  if timer.level == party.level then\
--  pr.nt(\"tick from dust timer on level \"..timer.level)\
    quakeDust()\
  end\
end\
\
----------------------------\
\
tickAmount = 70\
quakeDustTick = 0\
function quakeDust() -- trig repeatedly by quakeDustTimers 0.1s via dustTimer(timer)\
  local dustTargY = {-3, -2, -1, 0, 1, 2, 3}\
  local dY = dustTargY[math.random(1, #dustTargY)]\
  local dustTargX = {-3, -2, -1, 0, 1, 2, 3}\
  local dX = dustTargX[math.random(1, #dustTargX)]\
  if quakeDustTick < tickAmount then\
     quakeDustTick = quakeDustTick + 1\
--   pr.nt(quakeDustTick)\
     if party.level ~= 5 then\
        spawn(\"fx\", party.level, party.x+dX, party.y+dY, 0)\
         :setParticleSystem(\"earthquake_dust\")\
     end -- this avoids dust in wakeland\
    else\
     for i=1,5 do\
       findEntity(\"quakeDustTimer\"..i):destroy()\
     end\
 --pr.nt(\"quakeDustTimers destroyed\")\
     quakeDustTick = 0\
     restAfter() -- at bottom, to allow resting after quake is done\
  end\
  if quakeDustTick == 2 then\
     party:shakeCamera(0.10, 1.2)\
  end\
  if quakeDustTick == 10 then\
     quakeShake()\
     party:wakeUp(false)\
  end\
end\
\
function quakeShake()\
  if tickAmount == 70 then\
     party:shakeCamera(0.25, 6)\
--pr.nt(\"shaking for 6s\")\
    else\
     party:shakeCamera(0.35, 9)\
--pr.nt(\"shaking for 9s\")\
  end\
end\
\
function restAfter() -- trig by quakeDust() end\
  spawn(\"timer\",party.level,0,0,0,\"restAfterTimer\")\
   :setTimerInterval(1.3)\
   :addConnector(\"activate\", \"quakeScript\", \"setRest\")\
   :activate()\
end\
\
function setRest()\
  quakeNow = 0\
  restAfterTimer:destroy()\
--pr.nt(\"restAfterTimer destroyed, can rest now\")\
end\
-- There is a party hook that disallows resting if\
-- quakeNow == 1\
")
spawn("script_entity", 6,21,1, "univTimerScript")
	:setSource("--------------------------------------------------------------\
\
for i=1,6 do\
  spawn(\"timer\",i,0,0,0,\"univTimer\"..i)\
   :setTimerInterval(1)\
   :addConnector(\"activate\", \"univTimerScript\", \"univTimer\")\
   :activate()\
end\
\
function univTimer(timer)\
  if timer.level == party.level then\
--  pr.nt(\"tick from timer on level \"..timer.level)\
    univTicker()\
  end\
end\
\
----------------------------------------\
\
univTick = 0\
\
function univTicker()\
  univTick = univTick+1\
--pr.nt(univTick)\
\
  if party.level ~= 6  then \
     quakeScript.quakeEventTicker()\
  end\
end\
\
")
