spawn("script_entity", 31,0,1, "script_wall_text_1")
	:setSource("---------\
--LEVEL 1\
---------\
function grantXP() \
  local xp\
  if xpPlate1:isDown() then xp = 300\
  elseif xpPlate2:isDown() then xp = 500\
  elseif xpPlate3:isDown() then xp = 1000 end \
  hudPrint(\"Dungeon level completed, \"..xp..\" XP gained\")\
  playSound(\"generic_spell\")\
  for i=1,4 do party:getChampion(i):gainExp(xp) end\
end\
\
function CounterSecretPrison()\
\9local nbre = counter_3:getValue()\
\9hudPrint(nbre.. \" secrets out of 37\")\9\
end\
\
\
\
-- wall text\
d_walltext_1:setWallText(\"Jails\")\
d_walltext_2:setWallText(\"Forgotten Cells\")\
d_walltext_3:setWallText(\"Maximum Security\")\
d_walltext_4:setWallText(\"Catacombs\")\
d_walltext_5:setWallText(\"Main Slammer\")\
d_walltext_6:setWallText(\"Individual Cells\")\
d_walltext_7:setWallText(\"Detention Camp\")\
d_walltext_8:setWallText(\"Torture Room\")\
d_walltext_9:setWallText(\"Laboratory Correction\")\
d_walltext_10:setWallText(\"Labyrinth of Condemnation\")\
d_walltext_11:setWallText(\"Cells Teleporters\")\
d_walltext_12:setWallText(\"To The Catacombs\")\
d_walltext_13:setWallText(\"Warning: Sealing Passage\")\
d_walltext_14:setWallText(\"Training Room\")\
d_walltext_15:setWallText(\"Quarters\")\
\
-- wall text long\
d_walltext_l_1:setWallText(\"Main Maximum Security Area.\\nAttention: Entrance Protected\")\
d_walltext_l_2:setWallText(\"Pauper's Grave\")\
d_walltext_l_3:setWallText(\"A figure that is seen on a map\")\
d_walltext_l_4:setWallText(\"You have to look from the top\")\
d_walltext_l_5:setWallText(\"A stone falling into a hole\")\
d_walltext_l_6:setWallText(\"You have to look up\")\
\
\
--ANONYME\
local messagel = spawn(\"note\")\
messagel:setScrollText(\"Knowing they were going to send me here,\\nand knowing the Orwak rumors,\\nI put this compass in my pocket.\\nBut I couldn't use it.\\nThe wall closes, I don't know how.\\nI'll rot here forever.\\nThis prison is cursed\\nHelp, help me!\\nI think I'm going crazy.\\nI hear noises yet,\\nbut nobody hears me.\\n_____\\nAnonymous\")\
corpse_note_a_note_1:addItem(messagel)\
\
a_scroll_1:setScrollText(\"I was thrown into this horrible hole,\\nand broke my leg when I fell.\\nBut I'm innocent, I swear.\\nNow I'm going to die here, that's certain.\\nTalk about a prison! Before, yes, possibly I'd survive.\\nBut today looks far worse.\\nThey just drop those they want to forget.\\nMy torch fades, it will be pitch black soon.\\nIt is to this light that we should go.\\nBut I can not move because of my leg.\\nI curse those who condemn me in this death.\\nThis is the end. I'm so hungry ...\\n_____\\nAnonymous\")\
\
local messagek = spawn(\"scroll\")\
messagek:setScrollText(\"It is the jails that awaits us,\\nif one falls in the Prison of Orwak. \\nOtherwise we will end up at a impasse,\\nlost at the far end of the forgotten cells.\\nI'm not strong enough\\nto survive in the main maximum security area\\nbut this is the only way\\nto reach the catacombs.\\nThis is what I was told.\\n_____\\nAnonymous\")\
prison_bench_alcove_a_scroll_2:addItem(messagek)\
\
--PRISONNIERS\
local messagei = spawn(\"note\")\
messagei:setScrollText(\"Damn, I need to steal some food.\\nI was only sentenced to a few months in prison.\\nThat's it. I had only a few days left.\\nIn the past, a thief just had a hand cut off and it was over.\\nAnd those cursed guards, who mocked and taunted me,\\nthey all left, but we are still here.\\nWe will die of hunger or thirst.\\nOpen our cells! At least leave the key.\\nIt is useless, they are all gone.\\nThey left Orwak and no one knows why.\\nAnd me. I'm going to die in this cell.\\n_____\\nAnonymous Prisoner\")\
corpse_note_p_note_1:addItem(messagei)\
\
p_note_2:setScrollText(\"It's been days since anyone has come.\\nThere is a lack of food.\\nI haven't eaten for two days.\\nThey gave us food before they left,\\nBut the last guard,\\nI saw him five days ago.\\nI heard strange noises\\nAs if they were fighting.\\nIs someone coming to free us?\\nOr is the prison under attack?\\nIf they fight against the guards,\\nwhy not come to relieve us\\nand open the door?\\nIt is not possible they've forgotten us;\\nwe are more than thirty in the common block.\\nThis will become our mass grave.\\nWe are all going to die.\\n_____\\nAnonymous Prisoner\")\
\
p_note_3:setScrollText(\"This labyrinth is a real pain.\\nFor two hours, I've been turned around.\\nIf only I had a compass.\\nAnd those cursed Crowerns!\\nThey never leave me in peace.\\nI promise, I will never rebel again!\\nI think these crow-wyverns,\\nare derived from Orwak laboratory .\\nThey torture us with this monster.\\nI had the choice between the lab\\nor this labyrinth. Bad choice.\\n_____\\nAnonymous Prisoner\")\
\
\
--GARDIENS\
\
local messageh = spawn(\"note\")\
messageh:setScrollText(\"The cells, you take care of the cells!\\nThey only speak these words.\\nThe prison collapses;\\nall the other guards fled.\\nAnd I have to take care of all the cells?\\nThere are how many prisoners there?\\nForced to pile them up, we stopped counting.\\nWell, you can all die;\\ndon't expect me to take care of you.\\nI'm like everyone else -\\nI'll save my skin and flee Orwak!\\n_____\\nAnonymous Guard\")\
note_hook_g_note_1:addItem(messageh)\
\
local messagej = spawn(\"note\")\
messagej:setScrollText(\"The other day they captured a Herder,\\nA true giant!\\nI don't know how they did it.\\nStill, they brought it here.\\nSince then, we have had fun with it.\\nWe tossed it down into the torture room.\\nIf a prisoner doen't say what we want to hear,\\nwe throw it directly on him.\\nThat usually brings good results!\\nOn the down side, it reproduces quickly.\\nI don't know how, because it is a half-plant.\\nIn only five days he has made eight offspring.\\nWe'll also put one down on the common block.\\nWe should be able to keep its population under control.\\nThis is a strange creature, a herder.\\n_____\\nAnonymous Guard\")\
note_hook_g_note_2:addItem(messagej)\
\
local messagem = spawn(\"note\")\
messagem:setScrollText(\"This herder business is a big mess.\\nFirst, it bred too fast,\\nThen it smashed two guards.\\nIt did damage to the facility,\\nand disappeared down into the catacombs.\\nThat place is forbidden. Now, I pray\\nit doesn't force us to go after it.\\nIt was difficult enough to seal the catacombs\\nwithout a damned herder undermining our work!\\nI have to find it, before my supervisors notice.\\n_____\\nAnonymous Guard\")\
prison_bench_alcove_g_note_3:addItem(messagem)\
\
g_note_4:setScrollText(\"I was asked to clean the room under the lab.\\nThere, the Great Teacher does strange things.\\nAnd, of course, we must clean up afterwards.\\nAbsolutely amazing, what I saw.\\nThere was a snail eating a corpse;\\nIt was the size of a man. Colossal!\\nThis is crazy. In addition, it was attacking me.\\nAnd to climb back up, it is quite difficult\\nto find the right button on the walls.\\nI wonder how he ended up here.\\n_____\\nAnonymous Guard\")\
\
local messagea = spawn(\"note\")\
messagea:setScrollText(\"We send rebel prisoners\\ninto the labyrinth.\\nWhat they do not know\\nis that if they succeed,\\nthey simply earn the right to go\\nin the teleporter room.\\n_____\\nAnonymous Guard\")\
alcove_g_note_5:addItem(messagea)\
\
local messagen = spawn(\"note\")\
messagen:setScrollText(\"I told them more than 100 times,\\nplug the cracks in the walls.\\nIf they do not do what I say,\\nwe will soon be overrun with snails.\\nEveryone knows when born,\\nthey are all small.\\nThus they go through,\\nthe cracks in the prison walls.\\nBut then they grow rapidly\\nand are retained in Orwak.\\nI don't want to find myself\\nwith a voracious snail horde here.\\nEspecially since\\nthey breed too quickly.\\n_____\\nAnonymous Guard\")\
note_hook_g_note_6:addItem(messagen)\
\
local messageb = spawn(\"note\")\
messageb:setScrollText(\"The Maximum Security area is open above.\\nThe well is a second opening,\\nwhich allows the channelling of prisoners.\\nBut the fall is greater, and\\nthey drop directly into the basement.\\nVery few survive in this case.\\nDue to this, it is still used as punishment,\\nbut better to use the main hall\\nto channel them into Orwak.\\n_____\\nAnonymous Guard\")\
wall_shelf_g_note_7:addItem(messageb)\
\
local messagec = spawn(\"note\")\
messagec:setScrollText(\"The sealing of the catacombs has taken place.\\nIt's impossible to go there now.\\nThey have converted our old quarters\\ninto two, highly secure, rooms.\\nIt was done quickly before leaving,\\nbut the instructor inspected everything.\\nHe wanted to ensure nobody finds the keys.\\nI do not know what there is below,\\nBut it seems important enough to mention.\\nAnyway, I'm glad to flee Orwak.\\nVery bizarre things happen here.\\n_____\\nAnonymous Guard\")\
grim_sqtable_g_note_8:addItem(messagec)\
\
g_note_9:setScrollText(\"I saw our Instructor putting a gold object\\nin the alcove of our room.\\nWhat is weird is that he then left,\\nleaving it on the spot, without fear of theft.\\nNobody tried to take it.\\nWe said that we should try.\\nA guard tried, but the door closed.\\nWhen he substituted another object,\\npoison gas came out.\\nFinally, he gave up like everyone else.\\nWhen the instructor came back later\\nhe always had his chalice in the alcove.\\nToo bad, it was worth a small fortune.\\n_____\\nAnonymous Guard\")\
\
\
--SAVANT\
\
local messageo = spawn(\"note\")\
messageo:setScrollText(\"I'm glad things are finally advancing,\\nand now I have a place for me.\\nMy essays on subjects are conclusive,\\nand they are ahead of all my expectations.\\nThe Teleporter's technology is amazing.\\nThis is a real step forward for us.\\nNobody has ventured into the basement,\\nbut we don't have to go down far to find a portal.\\nWho could have invented it and for what purpose?\\nGod knows what will be found further down.\\n_____\\nArianis great Teacher,\\nScholar of the Empire.\")\
note_hook_s_note_1:addItem(messageo)\
\
local messaged = spawn(\"note\")\
messaged:setScrollText(\"Why did I go to the basement?\\nI obviously enraged something,\\nwhen I wanted to analyze a portal.\\nSince then, many devious devices\\nhave started automatically\\nthroughout the Orwak prison.\\nStatues of undead soldiers\\nhave automatically revived.\\nTrap doors and hatches\\nthat engage automatically.\\nButtons and levers, previously inert,\\nhave restarted to kill us.\\nThe prison is more than the shadow of before.\\nNo matter that it kills prisoners;\\nif they learn that the disappearance of the guards\\nis my fault, I'm doomed.\\nBetter to flee and abandon the prison.\\n_____\\nArianis great Teacher,\\nScholar of the Empire.\")\
grim_sqtable_s_note_2:addItem(messaged)\
\
local messagee = spawn(\"scroll\")\
messagee:setScrollText(\"Shame to have to condemn the catacombs.\\nHowever, I'll be able to concentrate on\\nthe technique of teleportation now.\\nI have a lot of prisoners to test.\\nOrwak could become much more than a prison.\\nNew devices are expected to arrive.\\nI have lots of great projects here.\\nFirst. let's see how these torches work.\\n_____\\nArianis great Teacher,\\nScholar of the Empire.\")\
grim_sqtable_s_scroll_1:addItem(messagee)\
\
\
--TOORUM\
\
t_note_1:setScrollText(\"One can find anything in Orwak Prison.\\nNow anonymous, we just lay here.\\nThis is also my case.\\nBut, unlike many of them,\\nI'm not dead yet.\\nThere are corpses of former prisoners\\nlaying on the ground,\\nbut also those of former guards.\\nFor them I have no explanation,\\nbut there is visual evidence of something\\nterrible that occurrred when they tried to escape the prison.\\n_____\\nToorum\\nNote 1\")\
\
local messagef = spawn(\"note\")\
messagef:setScrollText(\"The training room is intriguing.\\nThe walls in the middle of the room are newer,\\nas if they had been recently built.\\nI should analyze with more height,\\nas the wall carving advises.\\nProbably the solution is seen from above.\\nI must be able to find a number.\\nProbably a code to select the correct button.\\nAnd support a number of times over.\\nIf I believe the nomenclature of the Empire,\\nthen it must be applied from the North.\\n_____\\nToorum\\nNote 2\")\
wall_shelf_t_note_2:addItem(messagef)\
\
t_note_3:setScrollText(\"There are also monsters in Orwak.\\nThe crowerns probably originated from here.\\nIt was used as a pet monster,\\nas guardian or as scavenger.\\nFor huge snails and herders,\\nI have a rational explanation.\\nThey swarm in abandoned places.\\nIn contrast, the undead warriors...\\nI wonder the reason for their presence.\\nThis place seems cursed.\\n_____\\nToorum\\nNote 3\")\
\
\
\
--ALCHIMIE\
\
al_scroll_1:setScrollText(\"Healing Potion : 1 Flask, 1 Tar Bead\\nEnergy Potion : 1 Flask, 1 Blooddrop Blossom\\nAntivenom : 1 Flask, 1 Cave Nettle\\nAntidote : 1 Flask, 1 Slime Bell, 1 Tar Bead\")\
")
