--NIVEAU 1--\
------------\
\
function enigmeglobal()\
hudPrint(\"I should take the compass and use it in my inventory, it seems to contain much more than it seems\")\
end\
\
function enigmealpha()\
if enigme_global:getValue() == 0 and enigme_reset_1:getValue() == 0 and enigme_1:getValue() >= 5 then\
hudPrint(\"I should probably find a stone\")\
end\
end\
\
\
function enigmeabeta()\
if enigme_global:getValue() == 0 and enigme_reset_2:getValue() == 0 and enigme_2:getValue() >= 3 and enigme_3:getValue() >= 3 then\
hudPrint(\"I should probably find a way to activate the plates at the same time\")\
end\
end\
\
function enigmeagamma()\
if enigme_global:getValue() == 0 and enigme_reset_5:getValue() == 0 and enigme_5:getValue() >= 3 and enigme_6:getValue() >= 3 then\
hudPrint(\"I should probably activate the two plates simultaneously\")\
end\
end\
\
function enigmec()\
if enigme_global:getValue() == 0 and enigme_reset_4:getValue() == 0 and enigme_4:getValue() >= 3 and enigme_4:getValue() < 6 then\
hudPrint(\"I should find a way to activate the remote plate\")\
elseif enigme_global:getValue() == 0 and enigme_reset_4:getValue() == 0 and enigme_4:getValue() >= 6 then\
hudPrint(\"By throwing a rock, no?\")\
end\
end\
\
function enigmed()\
if enigme_global:getValue() == 0 and enigme_reset_7:getValue() == 0 and enigme_7:getValue() >= 5 then\
hudPrint(\"I should use the right teleporter\")\
end\
end\
\
function enigmee()\
if enigme_global:getValue() == 0 and enigme_reset_8:getValue() == 0 and enigme_8:getValue() >= 8 then\
hudPrint(\"I should use the correct torch holder\")\
end\
end\
\
function enigmef()\
if enigme_global:getValue() == 0 and enigme_reset_9:getValue() == 0 and enigme_9:getValue() >= 1 then\
hudPrint(\"I can probably reach the plate across the portcullis with an item\")\
end\
end\
\
\
function enigmeg()\
if enigme_global:getValue() == 0 and enigme_12:getValue() == 2 and enigme_reset_13:getValue() == 0 and enigme_13:getValue() >= 1 then\
hudPrint(\"I feel like something is missing here\")\
elseif enigme_global:getValue() == 0 and enigme_12:getValue() == 2 and enigme_reset_13:getValue() == 0 and enigme_14:getValue() >= 1 then\
hudPrint(\"I should try to use my gems here\")\
end\
end\
\
function enigmeh()\
if enigme_global:getValue() == 0 and enigme_reset_15:getValue() == 0 and enigme_15:getValue() >= 5 then\
hudPrint(\"I should note which buttons don't generate monsters\")\
end\
end\
\
function enigmei()\
if enigme_global:getValue() == 0 and enigme_reset_16:getValue() == 0 and enigme_19:getValue() == 0 and enigme_16:getValue() >= 5 and enigme_16:getValue() < 10 then\
hudPrint(\"I should see what happens in the cells when I activate the teleporters\")\
elseif enigme_global:getValue() == 0 and enigme_reset_19:getValue() == 0 and enigme_19:getValue() == 1 and enigme_16:getValue() >= 5 then\
hudPrint(\"I should try to use the teleporters\")\
end\
end\
\
function enigmej()\
if enigme_global:getValue() == 0 and enigme_reset_16:getValue() == 0 and enigme_19:getValue() == 0 and enigme_16:getValue() >= 10  then\
hudPrint(\"There is a bag that travels from teleporter to teleporter when I active them; maybe its position is important?\")\
end\
end\
\
\
function enigmek()\
if enigme_global:getValue() == 0 and enigme_reset_16:getValue() == 0 and enigme_17:getValue() >= 5 then\
hudPrint(\"The buttons activate the teleporter in a single cell\")\
end\
end\
\
function enigmel()\
if enigme_global:getValue() == 0 and enigme_reset_16:getValue() == 0 and enigme_18:getValue() >= 10 then\
hudPrint(\"Only one button is useful to me if I want to grab the bag\")\
enigme_17:reset()\
end\
end\
\
function enigmem()\
if enigme_global:getValue() == 0 then\
hudPrint(\"I think I heard a door on in the distance...\")\
end\
end\
\
function enigmen()\
if enigme_global:getValue() == 0 and enigme_reset_23:getValue() == 0 and enigme_23:getValue() >= 5 and enigme_24:getValue() >= 5 then\
hudPrint(\"I think a door has opened further away. I should retrace my steps.\")\
end\
end\
\
function enigmeo()\
if enigme_global:getValue() == 0 and enigme_reset_24:getValue() == 0 and counter_9:getValue() <= 0 and counter_10:getValue() <= 0 and counter_11:getValue() <= 0 and counter_12:getValue() <= 0 and counter_13:getValue() <= 0 and counter_14:getValue() <= 0 and counter_15:getValue() <= 0 and counter_16:getValue() <= 0 and counter_9:getValue() > -4 and counter_10:getValue() > -4 and counter_11:getValue() > -4 and counter_12:getValue() > -4 and counter_13:getValue() > -4 and counter_14:getValue() > -4 and counter_15:getValue() > -4  and counter_16:getValue() > -4 then\
