end\
end\
\
function enigmep()\
if enigme_global:getValue() == 0 and enigme_reset_24:getValue() == 0 and counter_9:getValue() <= -4 and counter_10:getValue() <= -4 and counter_11:getValue() <= -4 and counter_12:getValue() <= -4 and counter_13:getValue() <= -4 and counter_14:getValue() <= -4 and counter_15:getValue() <= -4  and counter_16:getValue() <= -4 then\
