end\
end\
\
function enigmeq()\
if enigme_global:getValue() == 0 and enigme_reset_26:getValue() == 0 then\
hudPrint(\"I should enable only the good plates\")\
end\
end\
\
function enigmer()\
if enigme_global:getValue() == 0 and enigme_reset_26:getValue() == 0 and enigme_26:getValue() >= 3 and enigme_27:getValue() >= 3 and enigme_28:getValue() >= 3 and enigme_29:getValue() >= 3 and enigme_30:getValue() >= 3 and enigme_31:getValue() >= 3 and enigme_32:getValue() >= 3  and enigme_33:getValue() >= 3 then\
hudPrint(\"The good plates seem to have a link with the ceiling\")\
end\
end\
\
function enigmes()\
if enigme_global:getValue() == 0 and enigme_reset_35:getValue() == 0 and enigme_35:getValue() == 1 and enigme_37:getValue() >= 1 then\
