\
function enigmet()\
if enigme_global:getValue() == 0 and enigme_reset_35:getValue() == 0 and enigme_35:getValue() == 1 and enigme_36:getValue() >= 1 then\
hudPrint(\"The chalice seems to shine brighter here\")\
end\
end\
