spawn("script_entity", 4,31,1, "sequenceScript")
	:setSource("synchInterval = 0.1\
--[[All delays should be divisible by synchInterval.\
e.g. if synchInterval is 0.1 then acceptable\
delays are 0.1 , 0.2 , ... , 1.0 , 1.1 , ...\
Lower interval -> more precise timing & more cycles\
consumed synching. Adjust to your taste.\
--]]\
\
newSequence = function( copyFromSequence )\
\
\9initSynch()\
\
\9local s = {\
        copy = newSequence,\
\9\9--[[I kind of hate the syntax below. At first glance,\
\9\9it looks as if it's doing nothing, but it's absolutely\
\9\9necessary for the way this table works.\
\9\9--]]\
\9\9addEvent = addEvent,\
\9\9execute = execute,\
\9\9abort = abort,\
\9\9setInterruptMode = setInterruptMode,\
\9}\
\
\9if copyFromSequence then\
\9\9--[[There is a danger here: upvalues.\
\9\9Grimrock does not currently (US 3/9/2013) support\
\9\9upvalues, but I remain hopeful that it will eventually.\
\9\9If we simply copy the function as below,\
\9\9then we are actually referencing the same closure.\
\9\9I don't see any way around this. I'm afraid that\
\9\9this behavior will be an unpleasant surprise for\
\9\9some users.\
\9\9--]]\
\9\9s.eventCount = copyFromSequence.eventCount\
\9\9for i , v in ipairs(copyFromSequence) do\
\9\9\9s[i] = v\
\9\9end\
\9\9s.interruptMode = copyFromSequence.interruptMode\
\9else\
\9\9s.eventCount = 0\
\9end\
\
\9return s\
end\
\
addEvent = function( sequence , newEvent )\
\9local i = sequence.eventCount + 1\
\9sequence.eventCount = i\
\9sequence[i] = newEvent\
end\
\
execute = function( sequence , extraArgument )\
    if ( not sequence.currentEvent ) or ( sequence.interruptMode == \"restart\" ) then\
        sequence.extra = extraArgument\
        sequence.currentEvent = 1\
        sequence.tickTarget = nil\
        sequence.timerId = nil\
        executeEvent( sequence )\
    elseif sequence.interruptMode == \"parallel\" then\
        sequence:copy():execute( extraArgument )\
    end\
end\
\
abort = function( sequence )\
    sequence.currentEvent = nil\
    sequence.tickTarget = nil\
    sequence.timerId = nil\
end\
\
setInterruptMode = function( sequence , mode )\
--mode should be one of \"ignore\" , \"restart\" , or \"parallel\"\
--default is \"ignore\"\
    sequence.interruptMode = mode\
end\
\
------------------------------------------\
--[[Functions below this line are intended\
for internal use only.\
--]]\
\
initSynch = function()\
\9if synchInitialized then\
\9\9return\
\9end\
\
\9synchTimers()\
\9synchInitialized = true\
end\
\
timers = {}\
--Keys are timer id's. Values are sequences.\
\
synchTimers = function( synch )\
--ensure that all timers are on the same level as the party\
\9if ( not synch ) or\
\9\9( not ( synch.level == party.level ) ) then\
\
\9\9if synch then\
\9\9\9synch:destroy()\
\9\9end\
\
\9\9synch = spawn( \"timer\" , party.level , 0 , 0 , 0 )\
\9\9synch:setTimerInterval( synchInterval )\
\9\9synch:addConnector( \"activate\" , \"sequenceScript\" , \"synchTimers\" )\
\9\9synch:activate()\
\
\9\9local newTimers = {}\
\9\9for k , v in pairs( timers ) do\
            local timer = findEntity( k )\
            timer:destroy()\
            if v.tickTarget then\
                local newTimer = spawn( \"timer\" , party.level, 0 , 0 , 0 )\
                v.timerId = newTimer.id\
                newTimer:setTimerInterval( synchInterval )\
                newTimer:addConnector( \"activate\" , \"sequenceScript\" , v.tickTarget )\
                newTimer:activate()\
                newTimers[newTimer.id] = v\
            else\
                v.timerId = nil\
            end\
\9\9end\
\9\9timers = newTimers\
\
\9end\
end\
\
executeEvent = function( sequence )\
--this function is called to begin an event\
\
    if not sequence.currentEvent then\
        --aborted\
        return\
    end\
\
    local event = sequence[sequence.currentEvent]\
\
    if not event then\
        --reached the end of the sequence\
        sequence.currentEvent = nil\
        return\
    end\
\
\9if event.delayBefore then\
        sequence.tickTarget = \"delayBeforeTick\"\
        sequence.beforeTicks = nil\
\9\9local timer = spawn( \"timer\" , party.level , 0 , 0 , 0 )\
\9\9sequence.timerId = timer.id\
\9\9timer:setTimerInterval( synchInterval )\
\9\9timer:addConnector( \"activate\" , \"sequenceScript\" , sequence.tickTarget )\
\9\9timers[timer.id] = sequence\
\9\9timer:activate()\
\9else\
        runEventFunction( sequence )\
\9end\
end\
\
delayBeforeTick = function( timer )\
    local sequence = timers[timer.id]\
\
    if not ( sequence.timerId == timer.id ) then\
        --aborted or restarted\
        timers[timer.id] = nil\
        timer:destroy()\
        return\
    end\
\
    sequence.beforeTicks = ( sequence.beforeTicks or 0 ) + 1\
    if ( sequence.beforeTicks * synchInterval ) >= sequence[sequence.currentEvent].delayBefore then\
        sequence.tickTarget = nil\
        sequence.beforeTicks = nil\
        sequence.timerId = nil\
        timers[timer.id] = nil\
        timer:destroy()\
        runEventFunction( sequence )\
    end\
end\
\
delayAfterTick = function( timer )\
    local sequence = timers[timer.id]\
\
    if not ( sequence.timerId == timer.id ) then\
        --aborted or restarted\
        timers[timer.id] = nil\
        timer:destroy()\
        return\
    end\
\
    sequence.afterTicks = ( sequence.afterTicks or 0 ) + 1\
    if ( sequence.afterTicks * synchInterval ) >= sequence[sequence.currentEvent].delayAfter then\
        sequence.tickTarget = nil\
        sequence.afterTicks = nil\
        sequence.timerId = nil\
        timers[timer.id] = nil\
        timer:destroy()\
        sequence.currentEvent = sequence.currentEvent + 1\
        executeEvent( sequence )\
    end\
end\
\
runEventFunction = function( sequence )\
--this function is called to run the actual event code\
--and determine what to do immediately thereafter\
\
    if not sequence.currentEvent then\
        --aborted\
        return\
    end\
\
    local e = sequence[sequence.currentEvent]\
    e.event( sequence.extra )\
    if e.delayAfter then\
        sequence.tickTarget = \"delayAfterTick\"\
        sequence.afterTicks = nil\
        local timer = spawn( \"timer\" , party.level , 0 , 0 , 0 )\
        sequence.timerId = timer.id\
\9\9timer:setTimerInterval( synchInterval )\
\9\9timer:addConnector( \"activate\" , \"sequenceScript\" , sequence.tickTarget )\
\9\9timers[timer.id] = sequence\
\9\9timer:activate()\
    else\
        sequence.currentEvent = sequence.currentEvent + 1\
        executeEvent( sequence )\
    end\
end")
spawn("script_entity", 5,31,3, "script_entity_4")
	:setSource("--[[Please follow the directions in README.txt first.\
The text of this file may be copied into any script_entity in your mod.\
This example assumes that tile 15,15 on level 1 does not have anything\
in it, and that there is a portcullis with the id \"gate_1\" between\
the party and this tile. A connector within your mod should target the\
function onPressurePlate . I used a pressure plate, but any connector\
will do.\
--]]\
\
newSequence = sequenceScript.newSequence\
\
mySequence = newSequence()\
mySequence:addEvent{\
\9event = function()\
\9\9spawn( \"snail\" , 2 , 8 , 27 , 0 )\
\9end,\
\9delayAfter = 1,\
}\
mySequence:addEvent{\
\9event = function()\
\9\9hudPrint(\"Where did that snail come from?\")\
\9end,\
\9delayAfter = 0.5,\
}\
mySequence:addEvent{\
\9event = function()\
\9\9gate_1:open()\
\9end,\
}\
\
function onPressurePlate()\
\9anotherSequence:execute()\
end\
\
anotherSequence = newSequence()\
anotherSequence:addEvent{\
\9event = function()\
\9\9hudPrint(\"The air behind the gate appears to be congealing\")\
\9end,\
}\
anotherSequence:addEvent{\
\9delayBefore = 3,\
\9event = function()\
\9\9mySequence:execute()\
\9end,\
}\
")
