spawn("script_entity", 9,31,3, "utilityScript")
	:setSource("allEntities = function( level )\
\
   local s = {}\
   s[\"offset\"] = 0\
   local c = 0\
    for i=0,31 do\
       for j=0,31 do\
             for k in entitiesAt(level,i,j) do\
                c = c + 1\
                s[c] = k\
             end\
        end\
    end\
\
    local f = function ( s , v )\
\
        local offset = s[\"offset\"] + 1\
        s[\"offset\"] = offset\
         \
        return s[offset]\
    end\
\
    return f , s , nil\
end\
\
getXYFromDir = function ( dir )\
   if dir == 0 then\
      return 0 , -1\
   elseif dir == 1 then\
      return 1 , 0\
   elseif dir == 2 then\
      return 0 , 1\
   elseif dir == 3 then\
      return -1 , 0\
   end\
end")
spawn("script_entity", 10,31,1, "blockerScript")
	:setSource("allEntities = utilityScript.allEntities\
\
do --setup a duplicate for each illusionwalltwowayBlocker\
   local twoWays = {}\
   local c = 0\
   local maxDungeonLevel = 6\
\
   for level = 1,maxDungeonLevel do\
      for entity in allEntities( level ) do\
         if entity.name == \"illusionwalltwowayBlocker\" then\
            c = c + 1\
            twoWays[c] = entity\
         end\
      end\
   end\
   \
   for i , v in ipairs( twoWays ) do\
      local x , y = utilityScript.getXYFromDir( v.facing )\
      x = x + v.x\
      y = y + v.y\
      spawn( \"illusionwalltwowayBlocker\" , v.level , x , y ,\
       ( v.facing + 2 ) % 4 )\
   end\
end\
\
blockers = { \"illusionwallBlocker\" ,\
          \"illusionwalltwowayBlocker\" ,\
\9\9\9\"illusioncatacombclearBlocker\",\
\9\9\9\"illusioncatacombdownBlocker\",\
\9\9\9\"illusioncatacombupBlocker\",\
\9\9\9\"anti_click\"}\
reverseBlockers = {}\
for i , v in ipairs( blockers ) do\
   reverseBlockers[v] = i\
end\
         \
isBlocker = function ( entity )\
   return reverseBlockers[entity.name]\
end")
