spawn("script_entity", 1,31,2, "script_wall_text_2")
	:setSource("---------\
--LEVEL 2\
---------\
\
function CountSecretCatacomb()\
\9local nbre = count_secret_lvl2:getValue()\
\9hudPrint(nbre.. \" secrets out of 27\")\9\
end\
\
\
-- wall text\
d_walltext_16:setWallText(\"Hall of Change\")\
d_walltext_17:setWallText(\"Hall of Illusions\")\
d_walltext_18:setWallText(\"Death pierces\")\
d_walltext_19:setWallText(\"Death through\")\
\
-- wall text long\
d_walltext_l_7:setWallText(\"In the catacombs, only the dead need patience\")\
d_walltext_l_8:setWallText(\"Launch of Illusions\")\
d_walltext_l_9:setWallText(\"The child born blank\")\
d_walltext_l_10:setWallText(\"The old one died impure\")\
d_walltext_l_11:setWallText(\"The death atones for his vices\")\
d_walltext_l_12:setWallText(\"Ashes rest in peace\")\
\
\
--TOORUM\
\
t_note_4:setScrollText(\"I know that the skeleton warriors,\\nI've seen above, come here.\\nThe catacombs.\\nThe closure of this place brought me\\nsome problems while trying to open it.\\nApparently the guards, before leaving,\\ntried to seal the catacombs.\\nBut these undead warriors\\nseem to ignore that seal.\\nEither they go in through the walls,\\nor they've found another passage.\\n_____\\nToorum\\nNote 4\")\
\
\
--GARDIEN\
\
local messagep = spawn(\"note\")\
messagep:setScrollText(\"They built the Orwak Prison\\non ancient catacombs.\\nIn fact, the prison's infrastructure,\\nexisted before we got there.\\nIt just needed to be rearranged a bit.\\nI think I'm onto something:\\nInstructor Arianis uses the dead.\\nI have seen him go into the catacombs\\nand come back filled with corpses.\\nAnd it wasn't only once.\\n_____\\nAnonymous Guard\")\
corpse_note_g_note_10:addItem(messagep)\
\
g_note_11:setScrollText(\"It is forbidden to go further here.\\nI don't know why and I don't care;\\nI don't want to go further, anyway.\\nThis place gives me the creeps.\\nIf I didn't work for that crazy Arianis,\\nI would never have come.\\nI don't know how many corpses he needs.\\nI hate this job.\\n_____\\nAnonymous Guard\")\
\
local messageq = spawn(\"note\")\
messageq:setScrollText(\"A prison built on catacombs.\\nThat's not even the worst of it.\\nFirst, to successfully reach Orwak -\\nit's not easy at the top of this mountain.\\nBut to put the prison on a place of death,\\nthey weren't thinking very well.\\nIf I had known there was all this\\nbelow the Orwak prison,\\nI never would have wanted to be a guard here.\\nAnd now I must follow Arianis for his dirty work.\\nI hate this man.\\n_____\\nAnonymous Guard\")\
dung_catac_alcov_g_note_12:addItem(messageq)\
\
local messager = spawn(\"note\")\
messager:setScrollText(\"This is our final trip here.\\nTomorrow they will close off the catacombs.\\nArianis is furious at this conclusion.\\nHe probably wanted to continue his experiments.\\nFrankly, I do not care about his projects.\\nHe wants me to hide the key.\\nI leave this note because it is possible\\nwe may come back one day; you never know.\\nI put the key rather closeby.\\nOn an dead ancient, but a bit high.\\nIt is not easy to see it,\\nbut it shines a little in the dark.\\n_____\\nAnonymous Guard\")\
dung_catac_alcov_r_g_note_13:addItem(messager)\
\
local messages = spawn(\"note\")\
messages:setScrollText(\"Damnable spiders!\\nThey are monstrous.\\nBigger than a man and stronger.\\nOriginally, when we came here,\\nthere were many. They was swarming.\\nBut they were defeated. We lost two guards,\\nbut we thought we killed all of them.\\nHowever, we forgot to seal their lair.\\nNow there are even more, below.\\nNobody wants to go down.\\nWe're setting fire to them by throwing torches,\\nbut I don't know if it will be enough.\\n_____\\nAnonymous Guard\")\
corpse_note_g_note14:addItem(messages)\
\
--SAVANT\
\
local messageg = spawn(\"scroll\")\
messageg:setScrollText(\"This is wonderful. Corpses everywhere!\\nI can progress much faster.\\nScience will take a big step forward.\\nI have living guinea pigs with the prisoners,\\nand dead guinea pigs with the catacombs.\\nAnd if the prisoners die with my tests,\\nwell, they will join the dead here.\\nThe cycle is completed.\\nThe Emperor will be pleased.\\n_____\\nArianis great Teacher,\\nScholar of the Empire.\")\
swap_altar_s_scroll_2:addItem(messageg)\
\
\
--ALCHIMIE\
\
wooden_box_catacomb:addItem(spawn(\"scroll\"):setScrollText([[\
Sulphurous Potion : 1 Flask, 1 Grim Cap, \
1 Blooddrop Blossom and..\
I'm missing one more ingredient.\
]]))")
