spawn("script_entity", 0,31,0, "script_enigme_text_2")
	:setSource("-----------\
--LEVEL 2--\
-----------\
\
function enigmeaa()\
if enigme_global:getValue() == 0 and enigme_reset_38:getValue() == 0 and enigme_38:getValue() >= 7 then\
hudPrint(\"I should stay longer on the plate\")\
end\
end\
\
function enigmeab()\
if enigme_global:getValue() == 0 and enigme_reset_39:getValue() == 0 and enigme_39:getValue() >= 5 and enigme_40:getValue() >= 5 then\
hudPrint(\"The torches in this room have something weird; I should try to see if I can change that\")\
end\
end\
\
function enigmeac()\
if enigme_global:getValue() == 0 and enigme_reset_45:getValue() == 0 and enigme_reset_39:getValue() == 0 and enigme_41:getValue() >= 2 and enigme_42:getValue() >= 2 and enigme_43:getValue() >= 2 and enigme_44:getValue() >= 2 and enigme_45:getValue() >= 2 and enigme_46:getValue() >= 2 then\
hudPrint(\"The four sconces in the recesses have no torch, while the two sconces against the walls have torches. I must change them.\")\
end\
end\
\
function enigmead()\
if enigme_global:getValue() == 0 and enigme_reset_39:getValue() == 0 and enigme_41:getValue() >= 5 and enigme_42:getValue() >= 5 and enigme_43:getValue() >= 5 and enigme_44:getValue() >= 5 and enigme_45:getValue() >= 5 and enigme_46:getValue() >= 5 then\
enigme_reset_45:setValue(1)\
hudPrint(\"The four sconces in the recesses have no torch, while the two sconces against the walls have torches. I must invert them.\")\
end\
end\
\
function enigmeae()\
if enigme_global:getValue() == 0 and enigme_reset_47:getValue() == 0 and enigme_47:getValue() >= 3 and enigme_47:getValue() < 5 then\
hudPrint(\"I should try the other hole\")\
elseif enigme_global:getValue() == 0 and enigme_reset_47:getValue() == 0 and enigme_47:getValue() >= 5 then\
hudPrint(\"I should throwing something, no?\")\
end\
end\
\
function enigmeaf()\
if enigme_global:getValue() == 0 and enigme_reset_48:getValue() == 0 and enigme_reset_49:getValue() == 0 and enigme_48:getValue() >= 3 and enigme_49:getValue() >= 3 then\
hudPrint(\"I should activate the plates faster\")\
end\
end\
\
function enigmeag()\
if enigme_global:getValue() == 0 and enigme_reset_48:getValue() == 0 and enigme_48:getValue() >= 6 and enigme_49:getValue() >= 6 then\
enigme_reset_49:setValue(1)\
hudPrint(\"I should enable the two plates faster, without blocking the shot\")\
end\
end\
\
\
function enigmeah()\
if enigme_global:getValue() == 0 and enigme_reset_51:getValue() == 0 and enigme_51:getValue() == 1 and enigme_52:getValue() >= 1 then\
hudPrint(\"It seems that the orbits of the statue may contain something\")\
elseif enigme_global:getValue() == 0 and enigme_reset_51:getValue() == 0 and enigme_51:getValue() == 1 and enigme_53:getValue() >= 1 then\
hudPrint(\"I should check my inventory to see if something I received recently might help.\")\
end\
end\
\
\
function enigmeai()\
if enigme_global:getValue() == 0 and enigme_reset_54:getValue() == 0 and enigme_reset_55:getValue() == 0 and enigme_54:getValue() >= 3 and enigme_55:getValue() >= 3 and enigme_56:getValue() >= 3 then\
hudPrint(\"There are many ways for the projectile to reach its target, but I should pick only one\")\
end\
end\
\
function enigmeaj()\
if enigme_global:getValue() == 0 and enigme_reset_55:getValue() == 0 and enigme_54:getValue() >= 6 and enigme_55:getValue() >= 6 and enigme_56:getValue() >= 6 then\
enigme_reset_54:setValue(1)\
hudPrint(\"I should try placing an item on the middle plate at the end\")\
end\
end\
\
function enigmeak()\
if enigme_global:getValue() == 0 and enigme_reset_58:getValue() == 0 and enigme_57:getValue() >= 1 then\
hudPrint(\"We must make a sacrifice here\")\
elseif enigme_global:getValue() == 0 and enigme_reset_58:getValue() == 0 and enigme_58:getValue() >= 1 then\
hudPrint(\"We must make sacrifice an item here\")\
end\
end\
\
function enigmeal()\
if enigme_global:getValue() == 0 and enigme_reset_60:getValue() == 0 and enigme_59:getValue() >= 1 and enigme_60:getValue() >= 1 and enigme_61:getValue() >= 1 and enigme_62:getValue() >= 1 then\
hudPrint(\"I should put them in the alcoves in the middle\")\
end\
end\
\
function enigmeam()\
if enigme_global:getValue() == 0 and enigme_reset_60:getValue() == 0 and enigme_reset_62:getValue() == 0 and enigme_63:getValue() >= 3 then\
hudPrint(\"This symbolizes the thread of life\")\
end\
end\
\
function enigmean()\
if enigme_global:getValue() == 0 and enigme_reset_60:getValue() == 0 and enigme_reset_63:getValue() == 0 and enigme_63:getValue() >= 5 then\
enigme_reset_62:setValue(1)\
hudPrint(\"The first symbolizes birth, the second is the death, the third is the mind and the last is the tomb\")\
end\
end\
\
function enigmeao()\
if enigme_global:getValue() == 0 and enigme_reset_60:getValue() == 0 and enigme_63:getValue() >= 7 then\
enigme_reset_63:setValue(1)\
hudPrint(\"Birth is bone, death is the blood, the mind is the devil and the tomb is the stone\")\
end\
end\
")
