\
\
function launchBouldersSound()\
\9local boulder_sound_timer = findEntity(\"boulder_sound_timer\")\
\9if boulder_sound_timer == nil then\
\9\9local boulder_sound_timer = spawn(\"timer\", party.level, party.x, party.y, party.facing, \"boulder_sound_timer\")\
\9\9boulder_sound_timer:addConnector(\"activate\", \"boulder_script\", \"doBoulderSounds\")\
\9\9boulder_sound_timer:setTimerInterval(1)\
\9\9boulder_sound_timer:activate()\
\9end\
end\
\
\
function doBoulderSounds()\
\9for i in allEntities(party.level) do\
      \9if i.name == \"boulder\" then\
\9\9\9checkDistanceFromParty(i)\
\9\9end\
\9end\9\
end\
\
function checkDistanceFromParty(boulder)\
\9local distance = math.floor(math.sqrt (math.pow(party.x - boulder.x,2) + math.pow(party.y - boulder.y,2)))\
\9--print(\"boulder distance\"..distance..\"\")\
\9if distance <= 1 then\
\9\9party:shakeCamera(.05, 2)\
\9\9party:playScreenEffect(\"earthquake_dust\")\
\9\9playSoundAt(\"boulder_rolling\", party.level, boulder.x, boulder.y)\
\9elseif distance <= 2 then\
\9\9party:shakeCamera(.04, 2)\
\9\9party:playScreenEffect(\"earthquake_dust\")\
\9\9playSoundAt(\"boulder_rolling\", party.level, boulder.x, boulder.y)\
\9elseif distance <= 3 then\
\9\9party:shakeCamera(.03, 2)\
\9\9party:playScreenEffect(\"earthquake_dust\")\
\9\9playSoundAt(\"boulder_rolling\", party.level, boulder.x, boulder.y)\
\9elseif distance <= 4 then\
\9\9party:shakeCamera(.02, 2)\
\9\9party:playScreenEffect(\"earthquake_dust\")\
\9\9playSoundAt(\"boulder_rolling\", party.level, boulder.x, boulder.y)\
\9elseif distance <= 5 then\
\9\9party:shakeCamera(.01, 2)\
\9\9party:playScreenEffect(\"earthquake_dust\")\
\9\9playSoundAt(\"boulder_rolling\", party.level, boulder.x, boulder.y)\
\9end   \
end")
