\
\
\
MoveAltar = function ( self , dir )\
local movealtar = false\
local direction = 0\
for _,pp in pairs(partyplaces) do\
    if (self.x == pp.x) and (self.y == pp.y) and (self.facing == pp.facing) and (dir == pp.facing) and counter_move_altar:getValue() == 0 then \
    movealtar = true\
    direction = dir\
\9end\
\9\
\9if (movealtar) then\
\9timer_move_altar:activate()\
\9\
    local dx,dy = getForward(direction)\
    xa = 6 + dx\
    ya = 9 + dy\
\9\
\9\
\9playSound(\"door\")\
    spawn(\"dust_emitter\",party.level,xa,ya,3)\
\9spawn(\"dust_emitter\",party.level,6,9,1)\
\9counter_move_altar:setValue(1)\
\9end\
end\
end \
\
function timemovealtar()\
findEntity(\"altar_move\"):destroy()\
spawn(\"deep_dungeon_altar\",party.level,xa,ya,2,\"altar_move\")\
end\
\
")
