if (enigme_global:getValue() == 0 and enigme_reset_65:getValue() == 0 and enigme_65:getValue() >= 3) or (enigme_global:getValue() == 0 and enigme_reset_65:getValue() == 0 and enigme_66:getValue() >= 5) then\
hudPrint(\"I should throw something in the teleporter at the right time\")\
end\
end\
\
function enigmebc()\
if enigme_global:getValue() == 0 and enigme_reset_67:getValue() == 0 and enigme_67:getValue() >= 4 and enigme_68:getValue() >= 5  then\
hudPrint(\"I should stand on a plate and activate the other plate with an object\")\
end\
end\
\
function enigmebd()\
if enigme_global:getValue() == 0 and enigme_reset_69:getValue() == 0 and enigme_69:getValue() >= 4 and enigme_69:getValue() < 7 then\
hudPrint(\"The teleporters work differently with an object\")\
elseif enigme_global:getValue() == 0 and enigme_reset_69:getValue() == 0 and enigme_69:getValue() >= 7  then\
hudPrint(\"The teleporters that are triggered by objects are brighter, but they must be activated first\")\
