end\
\
function enigmebe()\
if enigme_global:getValue() == 0 and enigme_reset_70:getValue() == 0 and enigme_70:getValue() >= 3 then\
hudPrint(\"The colors on the ceiling should be linked with gems\")\
end\
end\
\
\
\
function enigmebf()\
if enigme_global:getValue() == 0 and enigme_reset_71:getValue() == 0 and enigme_71:getValue() >= 5 then\
hudPrint(\"And if I tried to block the herders in cell\")\
end\
end\
\
\
function enigmebg()\
if enigme_global:getValue() == 0 and enigme_reset_72:getValue() == 0 and enigme_72:getValue() >= 4 then\
